import React from "react";

const App = () => {
  return (
    <>
      <div className="main-div">
        <div className="child-div">
          <h1>Add Your List Here</h1>

          <div className="AddItems">
            <input type="text" placeholder="Add Items..." />
            <button>+</button>
          </div>

          <div
            className="showItems"
            style={{
              display: "flex",
              alignItems: "center",
              flexDirection: "row",
            }}
          >
            <div className="eachItem">
              <h3>Apple</h3>
              <button>-</button>
            </div>
          </div>
          <br />
          <div>
            <button>Remove All</button>
          </div>
        </div>
      </div>
    </>
  );
};

export default App;
